$_MODULE['<{lgcanonicalurls}prestashop>help_8ed13673d7f52012cb133732c82a31e2'] = 'Klicken Sie auf die Schaltfläche Speichern';
$_MODULE['<{lgcanonicalurls}prestashop>help_f186ab8d807797321861ea3017778973'] = 'Um die kanonische URL zu sehen, müssen Sie nur die Seite in Ihrem Front-Office öffnen, mit der rechten Maustaste klicken, auf „Quellcode der Seite“ klicken und nach dem Ausdruck „canonical“ suchen (Sie können STRG + F verwenden).';
$_MODULE['<{lgcanonicalurls}prestashop>help_22a7f063e7f26a07c9bb654e9ba815cf'] = 'Informieren Sie Google über lokalisierte Versionen Ihrer Seite';
$_MODULE['<{lgcanonicalurls}prestashop>help_9275a4f9c598ae359d56b7745d061c57'] = 'Wenn Sie mehrere Versionen einer Seite für verschiedene Sprachen oder Regionen haben, informieren Sie Google über diese verschiedenen Varianten. Auf diese Weise wird die Google-Suche Nutzern helfen, die am besten geeignete Version Ihrer Seite nach Sprache oder Region zu finden.';
$_MODULE['<{lgcanonicalurls}prestashop>help_72b3c6197b2512dd740ac11293632613'] = 'Beachten Sie, dass Google auch ohne Maßnahmen möglicherweise andere Sprachversionen Ihrer Seite findet. Normalerweise ist es jedoch am besten, Ihre sprach- oder regionenspezifischen Seiten explizit anzugeben.';
$_MODULE['<{lgcanonicalurls}prestashop>help_092d2c999b57682f034c622b9597ccd6'] = 'Einige Beispielszenarien, in denen die Angabe alternativer Seiten empfohlen wird:';
$_MODULE['<{lgcanonicalurls}prestashop>help_fbdd76a069f3c6d649e8494222446cd9'] = 'Wenn Ihr Inhalt kleine regionale Unterschiede mit ähnlichem Inhalt aufweist, in einer einzigen Sprache. Beispielsweise könnten Sie englischsprachige Inhalte haben, die auf die USA, GB und Irland ausgerichtet sind.';
$_MODULE['<{lgcanonicalurls}prestashop>help_44f2b54e329e4bb4b5506aea04b833cf'] = 'Wenn der Inhalt Ihrer Website vollständig in mehrere Sprachen übersetzt wurde. Sie haben beispielsweise von jeder Seite sowohl eine deutsche als auch eine englische Version.';
$_MODULE['<{lgcanonicalurls}prestashop>help_97ad095864fccc01b3ad47f528aa1e55'] = 'Konfigurieren Sie Ihr hreflang-Tag';
$_MODULE['<{lgcanonicalurls}prestashop>help_a953b16682e47623df99d33d5511eba6'] = 'Hreflag-Tag im Header aktivieren';
$_MODULE['<{lgcanonicalurls}prestashop>help_6b6364ac41009982dfa58d2e531ddaa3'] = 'Aktivieren Sie diese Option, wenn Sie Google für jede Sprache eine alternative URL anzeigen möchten';
$_MODULE['<{lgcanonicalurls}prestashop>help_d37fc147e9717a3c4eb06bb9e6e51cb0'] = 'Sprach-/Regionscode einschließen';
$_MODULE['<{lgcanonicalurls}prestashop>help_4596abd0b6b17867da26aa03aa69b520'] = 'Wenn Sie mehrere Versionen einer Seite für verschiedene Regionen haben, aktivieren Sie diese Option, wenn Sie den Regionscode im hreflang-Tag hinzufügen möchten (\"en-GB\" statt \"en\")';
$_MODULE['<{lgcanonicalurls}prestashop>help_516989128610c7c0dcaf14f03776e1d1'] = 'Fügen Sie einen alternativen Link zum Sprachstandard hinzu';
$_MODULE['<{lgcanonicalurls}prestashop>help_2c42be2758a1530b8b26452783298991'] = 'Der reservierte hreflang=\"x-default\"-Wert wird verwendet, wenn keine andere Sprache/Region der Browsereinstellung des Benutzers entspricht. Dieser Wert ist optional, wird jedoch empfohlen, damit Sie die Seite steuern können, wenn keine Sprachen übereinstimmen. Eine gute Verwendung ist die Ausrichtung auf die Startseite Ihrer Website, auf der eine anklickbare Karte vorhanden ist, die es dem Benutzer ermöglicht, sein Land auszuwählen.';
$_MODULE['<{lgcanonicalurls}prestashop>_p_top_db5eb84117d06047c97c9a0191b5fffe'] = 'Die Unterstützung';
