$_MODULE['<{lgcanonicalurls}prestashop>info_message_82a6a36aec7f2f7cf893f3f3e0fc995a'] = 'Unser Modul stützt sich auf diese Funktionalität, um standardmäßig mit Prestashop 1.7.x zu arbeiten, und nimmt intern Änderungen an der Canonical vor.';
